<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width,initial-scale=1.0,maximum-scale=1.0">
  <title>Fancode Player</title>
  <style>
    body {
      font-family: 'Arial', sans-serif;
      margin: 0;
      padding: 0;
      background: linear-gradient(135deg,#242424,#3b5998);
      color: #fff;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      min-height: 95vh;
      text-align: center;
    }

    .loading-message {
      font-size: 18px;
      font-weight: bold;
      color: #ffcc00;
      margin-bottom: 10px;
      padding: 10px 20px;
      border-radius: 10px;
      background: rgba(255,255,255,0.1);
      border: 1px solid rgba(255,255,255,0.2);
      animation: glow 1.5s infinite alternate;
    }

    .player-container {
      width: 90%;
      max-width: 1000px;
      aspect-ratio: 16 / 11;
      border-radius: 12px;
      overflow: hidden;
      background: #000;
    }

    iframe {
      width: 100%;
      height: 100%;
      border: none;
      border-radius: 12px;
    }
  </style>
</head>
<body>
  <div class="player-container">
    <iframe id="contentFrame"
      allow="autoplay; fullscreen; encrypted-media"
      allowfullscreen
      sandbox="allow-same-origin allow-scripts allow-presentation allow-forms">
    </iframe>
  </div>
